import logo from './logo.svg';
import './App.css';

function al(){
    alert("asd");

}

function App() {
  return (
      <div className="App">
      <header className="App-header">
        <table>
          <tr>
            <th>Company</th>
            <th>Contact</th>
            <th>Country</th>
          </tr>
          <tr>
            <td>Alfreds Futterkiste</td>
            <td>Maria Anders</td>
            <td>Germany</td>
          </tr>
          <tr>
            <td>Centro comercial Moctezuma</td>
            <td>Francisco Chang</td>
            <td>Mexico</td>
          </tr>
        </table>  
        <button onClick={al}>click</button>       
      </header>
    </div>
  );
}

export default App;
